import React from 'react';
import 'bootstrap/dist/css/bootstrap.css'; // Importiere das Bootstrap-CSS
import NavbarComponent from './components/navbar'; // Passe den Pfad entsprechend an

function App() {
  return (
    <div>
      <NavbarComponent />
      <div className="container">
        <h1>Willkommen in meiner React Bootstrap App</h1>
        <p>Dies ist ein einfaches Beispiel, wie man die Bootstrap Navbar-Komponente verwendet.</p>
      </div>
    </div>
  );
}

export default App;
